import React from 'react';
import './MainAside.scss';

import newImg from '../../assets/images/Mohan-muruge.jpg';


function MainAside(props) {
    return (
        <section className="aside">
            <div className="aside__container">
                <p className="aside__header">Next Video</p>

                <div className="aside__next">
                <img className="aside__img" src={newImg} />
                <div classname="aside__header">
                    <h2 className="aside__newTitle">Become a Travel Pro</h2>
                    <h3 className="aside__author">Scotty Cranmer</h3>

                </div>

                </div>


            </div>
        </section>
    );
}

export default MainAside;
